import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [donorName, setDonorName] = useState("");
  const [donationType, setDonationType] = useState("");
  const [amountDonated, setAmountDonated] = useState(""); // Ensure this matches the backend field
  const [dateOfDonation, setDateOfDonation] = useState(new Date().toISOString().slice(0, 10)); // Set default to today's date
  const [donations, setDonations] = useState([]);
  const [editingDonation, setEditingDonation] = useState(null);

  useEffect(() => {
    const fetchDonations = async () => {
      try {
        const response = await fetch("http://localhost:8080/api/donations", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        });
        const data = await response.json();
        setDonations(data); // Set the donations in state
      } catch (err) {
        console.error("Error fetching donations", err);
      }
    };

    fetchDonations(); // Call the function when the component loads
  }, []); 

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8080/api/donations", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ 
          name: donorName,
          amountDonated: parseFloat(amountDonated),
          dateOfDonation,
          donationType,
        }),
      });

      const data = await response.json();
      console.log(data);
      setDonations([...donations, data]); // Add new donation to the list
      setDonorName(""); // Reset form
      setAmountDonated("");
      setDonationType("");


    } catch (err) {
      console.error("Error submitting data", err);
    }
  };

  return (
    <div>
      <h1>Donations</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder='FirstName LastName'
          value={donorName}
          onChange={(e) => setDonorName(e.target.value)}
        />
        <select value={donationType} onChange={(e) => setDonationType(e.target.value)}>
          <option value="">Select Donation Type</option>
          <option value="Money">Money</option>
          <option value="Food">Food</option>
          <option value="Clothing">Clothing</option>
          <option value="Other">Other</option>
        </select>
        <input
          type="number"
          placeholder='Amount Donated'
          value={amountDonated}
          onChange={(e) => setAmountDonated(e.target.value)}
        />
        <input
          type="date"
          value={dateOfDonation}
          onChange={(e) => setDateOfDonation(e.target.value)}
        />
        <button type="submit">Submit</button>
      </form>
      <h2>List of Recorded Donations</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Amount</th>
            <th>Date</th>
            <th>Donation Type</th>
          </tr>
        </thead>
        <tbody>
          {donations.map((donation) => (
            <tr key={donation.id}>
              <td>{donation.name}</td>
              <td>{donation.amountDonated}</td>
              <td>{new Date(donation.dateOfDonation).toLocaleDateString()}</td>
              <td>{donation.donationType}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
